————————————————————————
Happy Friday everyone! I hope you all are having a blessed day and are continuing to stay safe during these strange times! 
————————————————————————
The past few weeks have been full of growth & opportunity and so I am feeling extra blessed and grateful today!! It’s because of this that I wanted to get on and make a post sharing a bit more about myself and some of the blessings that have come my way recently! 
————————————————————————
As most of you now know from reading my posts, I struggle with anxiety, depression, and PTSD. It’s something that I have battled with for a long time and will probably continue to struggle with for the rest of my life. With that said, I have really been focused on trying to understand how these illnesses affect me personally, and how I can work on continuing to nurture my mental health. 
————————————————————————
In previous posts I’ve talked ALOT about the power of positive thinking. And I still believe it is the most important aspect to healing and promoting positive change into your life! Don’t get me wrong, it’s not an easy task, but it works! When we generate positive thoughts our cortisol levels decrease and our serotonin levels increase. So overtime when implemented into a self care regimen, this can have a major affect on your overall happiness and mental health. With that said, it is through this positive thinking that I have been able to nurture my mental health back into a place of balance. And since doing this, a lot of blessing have been coming my way and I am more excited than ever to see where this next year will take me! 
————————————————————————
Some changes and blessings that I’m really excited about —> 
▪️ My boyfriend and I started a landscaping company and have officially applied for our business name! 
▪️ I sold my car, and bought a new truck 
▪️ We’re going to be moving into a beautiful new home in October 
▪️And some REALLY exciting news that is to be announced in the next 4-6 weeks ( so #staytuned )😬😬
————————————————————————
